import React, { useContext } from "react";
import "./Portfolio.css";
import { Swiper, SwiperSlide } from "swiper/react";
import "swiper/css";
import video1 from "../../img/video1.mp4";
import video2 from "../../img/video2.mp4";
import video3 from "../../img/video3.mp4";
import video4 from "../../img/video4.mp4";
import { themeContext } from "../../Context";

const Portfolio = () => {
  const theme = useContext(themeContext);
  const darkMode = theme.state.darkMode;

  return (
    <div className="portfolio" id="portfolio">
      {/* heading */}
      <span style={{ color: darkMode ? 'white' : '' }}>Recent Projects</span>
      <span>Portfolio</span>

      {/* slider */}
      <Swiper
        spaceBetween={30}
        slidesPerView={3}
        grabCursor={true}
        className="portfolio-slider"
      >
        <SwiperSlide>
          <div className="video-container">
            <video src={video1} controls />
            <div className="video-description">
              <p>This is the first project description.</p>
            </div>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="video-container">
            <video src={video2} controls />
            <div className="video-description">
              <p>This is the second project description.</p>
            </div>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="video-container">
            <video src={video3} controls />
            <div className="video-description">
              <p>This is the third project description.</p>
            </div>
          </div>
        </SwiperSlide>
        <SwiperSlide>
          <div className="video-container">
            <video src={video4} controls />
            <div className="video-description">
              <p>This is the fourth project description.</p>
            </div>
          </div>
        </SwiperSlide>
      </Swiper>
    </div>
  );
};

export default Portfolio;
